@realDonaldTrump @seanhannity @LouDobbs I agree with you on one point: the American electoral system must be turned around. Urgent.
Away with the electors, each vote only counts for the candidate you believe in.
This is the only way to prevent the horror that began with your appointment as President after 2016.

Why should the ‘vote leave’ campaigners and champions be allowed to walk away unscathed as we crash into a no-deal, country wrecking Brexit?

(One particularly who was “saved” at the expense of public trust in the pandemic strategy!)

@Conservatives @BorisJohnson This is on you.
